import axios from "axios";
import { Component } from "react";

const url = "https://covid19.mathdro.id/api";

export const fetchData = async () => {
  try {
    const response = await axios.get(url);
    return response;
  } catch (error) {}
};

const componentDidMount = () => {
  this.fetchData();
};
